elementClick.customFunction:
const $injector = widgetContext.$scope.$injector;
const attributeService = $injector.get(widgetContext.servicesMap.get('attributeService'));
const currentUser = widgetContext.currentUser;
const attributesArray = [
    { key: 'displayFullBins', value: false },
    { key: 'displayLowBatteryBins', value: true },
    { key: 'displayOfflineBins', value: false }
];
attributeService.saveEntityAttributes({id: currentUser.userId, entityType: 'USER'},
    'SERVER_SCOPE', attributesArray, {ignoreLoading: true}).subscribe();

